column20:
"Strawberry banana, juicyfruit yeast ester. Smells a little like milkshake ipa. Sweet vanilla spice flavor. Creamy and thick. Deep blood orange develops after creamsicle pineapple. Not boozy, slowly warms the throat."
 -- as written by our customer Stefan 


